import React, { Component } from 'react';

class Task extends Component {
    render() {
        return <ul key={this.props.response.id}>
            <li>{this.props.response.task}</li>
            <li>{this.props.response.description}</li>
            <li>{this.props.response.status}</li>
            <li>
                <input type="checkbox" />
                <button>X</button>
            </li>
        </ul>
    }
}

export default Task;
